DROP TABLE IF EXISTS `T_ORDER`;
CREATE TABLE `T_ORDER` (
  `TRADING_DAY` varchar(8) NOT NULL COMMENT '交易日',
  `EXCH_ID` varchar(30) NOT NULL COMMENT '交易所代码',
  `ORDER_ID` varchar(20) NOT NULL COMMENT '报单编号',
  `MEMBER_ID` varchar(10) DEFAULT NULL COMMENT '会员代码',
  `ACCOUNT_ID` varchar(20) NOT NULL COMMENT '资金账号',
  `PORTFOLIO_ID` varchar(12) NOT NULL COMMENT '组合代码',
  `EXCH_CLIENT_ID` varchar(12) DEFAULT NULL COMMENT '股东代码',
  `TRADE_TYPE` varchar(1) DEFAULT NULL COMMENT '交易类型:',
  `INSTRUMENT_ID` varchar(50) DEFAULT NULL COMMENT '合约代码',
  `DIRECTION` varchar(1) NOT NULL COMMENT '买卖方向：买： 0， 卖：1',
  `OFFSET_FLAG` varchar(1) DEFAULT NULL COMMENT '开平标志:开仓：0，平仓：1，强平：2，平今：3，平昨：4，自动：5',
  `HEDGE_FLAG` varchar(1) DEFAULT NULL COMMENT '投机套保标志:投机:1，套,利：2，套保：3，做市商：4',
  `ORDER_PRICE_TYPE` varchar(1) DEFAULT NULL COMMENT '报单类型：任意价：1，限价：2，最优档:3,五档价：4',
  `LIMIT_PRICE` decimal(22,6) DEFAULT NULL COMMENT '价格',
  `VOLUME` decimal(13,0) DEFAULT NULL COMMENT '数量',
  `TIME_CONDITION` varchar(1) DEFAULT NULL COMMENT '有效期类型:立即完成，否则撤销:1,本节有效:2,当日有效:3,指定日期前有效,4,撤销前有效:5,集合竞价有效,6',
  `GTD_DATE` varchar(8) DEFAULT NULL COMMENT 'GTD日期',
  `VOLUME_CONDITION` varchar(1) DEFAULT NULL COMMENT '成交量类型:任何数量：1，最小数量：2，全部数量：3',
  `MIN_VOLUME` decimal(13,0) DEFAULT NULL COMMENT '最小成交量',
  `STOP_PRICE` decimal(22,6) DEFAULT NULL COMMENT '止损价',
  `FORCE_CLOSE_REASON` varchar(1) DEFAULT NULL COMMENT '强平原因：非强平：0，资金不足：1，客户超仓：2，会员超仓：3，持仓非整数倍：4，违规：5，其他：6，自然人临近交割：7，客户套保超仓：8',
  `IS_AUTO_SUSPEND` varchar(1) DEFAULT NULL COMMENT '自动挂起标志：否：0，是：1',
  `ORDER_SOURCE` varchar(1) DEFAULT NULL COMMENT '报单来源：来自参与者：0，来自管理员：1',
  `INSERT_TIME` varchar(8) DEFAULT NULL COMMENT '插入时间',
  `LOCAL_ORDER_ID` varchar(20) DEFAULT NULL COMMENT '本地报单编号',
  `BIZ_UNIT` varchar(250) DEFAULT NULL COMMENT '业务单元',
  `CANCEL_TIME` varchar(8) DEFAULT NULL COMMENT '撤销时间',
  `CANCEL_USER_ID` varchar(20) DEFAULT NULL COMMENT '撤单用户编号',
  `VOLUME_TRADED` decimal(13,0) DEFAULT NULL COMMENT '成交数量',
  `FROZEN_PERMIUM` decimal(19,3) DEFAULT NULL,
  `FROZEN_MARGIN` decimal(19,3) DEFAULT NULL COMMENT '冻结的保证金',
  `FROZEN_FEE` decimal(19,3) DEFAULT NULL,
  `ORDER_STATUS` varchar(1) DEFAULT NULL COMMENT '报单状态：初始状态：0，应答失败(未成交不在队列中)：1，应答成功(未成交还在队列中)：2:，确认成功(未成交还在队列中)：3，部分成交还在队列中：4，部分成交不在队列中：5，全部成交：6，撤单:7',
  `IS_AUTO` varchar(1) DEFAULT NULL COMMENT '自动报单标志',
  `USER_ID` varchar(20) DEFAULT NULL COMMENT '产品代码',
  `USER_CUSTOM` varchar(50) DEFAULT NULL COMMENT '报单状态',
  `ORDER_USER_ID` varchar(20) DEFAULT NULL COMMENT '下单用户编号',
  `ORDER_BATCH` varchar(50) DEFAULT NULL COMMENT '报单批号',
  `ERR_CODE` varchar(50) DEFAULT NULL COMMENT '错误代码',
  `ERR_MSG` varchar(255) DEFAULT NULL COMMENT '错误信息',
  PRIMARY KEY (`TRADING_DAY`,`EXCH_ID`,`ORDER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='委托表';

